import React from 'react';
import { FaArrowLeft } from 'react-icons/fa';
import ImgMicrosoft from '../../assets/images/microsoft.png';

import Footer from '../../components/footer';
import HeaderEmpresa from '../../components/headerEmpresa';
import Input from '../../components/inputs/index';


import '../../global.css';
import './style.css';


function PerfilEmpresa() {
    return (
        <div>
            <HeaderEmpresa />
            <div className="arrow">
                <FaArrowLeft color="white" size={24} />
            </div>

            <h1>Seu perfil</h1>
            <h1>Suas vagas</h1>

            <div className="image">
                <img src={ImgMicrosoft} alt="imagem da empresa" />
                <p>Editar foto</p>
            </div>


            <h1>Seus dados</h1>

            <Input label="Nome fantasia" name="nomeFantasia"/>
            <Input label="CNAE" name="nomeFantasia"/>
            <Input label="Whatsapp" name="nomeFantasia"/>
            <Input label="Razão social" name="nomeFantasia"/>
            

            <Input label="CEP" name="nomeFantasia"/>
            <Input label="Bairro" name="nomeFantasia"/>
            <Input label="Rua" name="nomeFantasia"/>
            <Input label="Número" name="nomeFantasia"/>
            <Input label="Estado" name="nomeFantasia"/>
            <Input label="Cidade" name="nomeFantasia"/>
            



            <Footer />
        </div>
    );
}

export default PerfilEmpresa;
